import "./Login.css";
import Header from "./Header";
import { useState } from "react";

const Login = () => {
    const [state, setState] = useState({
        id: "",
        password: "",
    }

    );
    return(
        <div className="Login">            
            <Header title={`login page`}/>
            <div>로그인</div>
            <div><textarea value={state.id} placeholder="아이디" /></div> 
            <div><textarea value={state.password} placeholder="비밀번호" /></div>
            <button>아이디 찾기</button>|
            <button>비밀번호 찾기</button>|
            <button>회원가입</button>
        </div>
    );
}

export default Login;
